    data: |
      SELECT ALL * FROM tab1 (FORMAT parquet) AS cor0 WHERE col2 NOT BETWEEN NULL AND + - col0 + + col0 + + CAST ( NULL AS INTEGER ) AND NOT col0 * + col0 IS NOT NULL;
  - name: tab1

outputs:
  - name: q634.out
    data: |
